import React from 'react';
import  './ExpensesList.css';
import ExpenseItem from './ExpenseItem';
import ExpensesFilter from './ExpensesFilter';

function ExpensesList(props)	{

	let conditionalContent = <p>No Items found !!!</p>;

    if (props.subExpenses.length > 0) {
        conditionalContent = props.subExpenses.map(exp => 
          <ExpenseItem
                key = {exp.id} 
                ItemDate = {exp.ItemDate}
                Title = {exp.Title}
                Price = {exp.Price}
            />  
        )
    }

	return (
        <div>
            <ExpensesFilter onChangeExpensesFilter = {expensesFilterHandler} selected={expenseFilterYear}/>
                {conditionalContent}
        </div>
	)
}

export default ExpensesList;
